import React, {useEffect} from 'react';
import axios from 'axios';

const Home = () => {
    const api = 'https://jsonplaceholder.typicode.com/users';

    useEffect(() => {
        axios.get(`${api}`)
            .then((res) => {
                console.log(res)
            })
            .catch((err) => {
                console.log(err)
            })
    })
    return (
        <div>
            Welcome Home!
        </div>
    )
}

export default Home;
